import React from 'react';

const ClientLogos = ({ title = "Trusted by Leading Companies", subtitle = "We're proud to partner with organizations worldwide" }) => {
  const clients = [
    { name: "Global Manufacturing Corp", logo: "🏭", industry: "Manufacturing" },
    { name: "International Retail Group", logo: "🛍️", industry: "Retail" },
    { name: "Healthcare Solutions Ltd", logo: "🏥", industry: "Healthcare" },
    { name: "Tech Innovations Inc", logo: "💻", industry: "Technology" },
    { name: "Educational Foundation", logo: "🎓", industry: "Education" },
    { name: "Energy Solutions Co", logo: "⚡", industry: "Energy" },
    { name: "Financial Services Group", logo: "🏦", industry: "Finance" },
    { name: "Transportation Network", logo: "🚚", industry: "Transportation" }
  ];

  return (
    <section className="section-compact bg-white relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute inset-0 bg-gradient-to-br from-primary-50/30 via-transparent to-travel-50/20"></div>
      <div className="absolute top-20 right-20 w-96 h-96 bg-primary-100/15 rounded-full blur-3xl animate-float-slow"></div>
      <div className="absolute bottom-20 left-20 w-80 h-80 bg-travel-100/15 rounded-full blur-3xl animate-float-slow" style={{animationDelay: '2s'}}></div>

      <div className="container-premium relative z-10">
        {/* Header */}
        <div className="text-center mb-16">
          <h2 className="text-section-title text-gray-900 mb-6">
            {title}
          </h2>
          <p className="text-body-large text-gray-600 max-w-3xl mx-auto">
            {subtitle}
          </p>
        </div>

        {/* Client Grid */}
        <div className="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-4 gap-8">
          {clients.map((client, index) => (
            <div 
              key={index}
              className="group flex flex-col items-center p-6 bg-white/80 backdrop-blur-sm rounded-2xl border border-white/40 shadow-sm hover:shadow-lg transition-all duration-300 hover:-translate-y-1"
            >
              {/* Logo */}
              <div className="w-16 h-16 mb-4 flex items-center justify-center text-4xl bg-gradient-to-br from-primary-100 to-primary-200 rounded-2xl group-hover:scale-110 transition-transform duration-300">
                {client.logo}
              </div>

              {/* Company Info */}
              <div className="text-center">
                <h3 className="text-sm font-bold text-gray-900 mb-1 group-hover:text-primary-700 transition-colors duration-300">
                  {client.name}
                </h3>
                <p className="text-xs text-gray-500">
                  {client.industry}
                </p>
              </div>
            </div>
          ))}
        </div>

        {/* Trust Indicators */}
        <div className="mt-16 pt-12 border-t border-gray-200">
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8 text-center">
            <div className="flex flex-col items-center">
              <div className="w-16 h-16 bg-gradient-to-br from-green-500 to-green-600 rounded-2xl flex items-center justify-center text-white text-2xl mb-4 shadow-lg">
                ✓
              </div>
              <h3 className="text-lg font-bold text-gray-900 mb-2">ISO Certified</h3>
              <p className="text-gray-600 text-sm">Quality Management System</p>
            </div>

            <div className="flex flex-col items-center">
              <div className="w-16 h-16 bg-gradient-to-br from-blue-500 to-blue-600 rounded-2xl flex items-center justify-center text-white text-2xl mb-4 shadow-lg">
                🔒
              </div>
              <h3 className="text-lg font-bold text-gray-900 mb-2">Data Protected</h3>
              <p className="text-gray-600 text-sm">Enterprise-grade security</p>
            </div>

            <div className="flex flex-col items-center">
              <div className="w-16 h-16 bg-gradient-to-br from-purple-500 to-purple-600 rounded-2xl flex items-center justify-center text-white text-2xl mb-4 shadow-lg">
                🌍
              </div>
              <h3 className="text-lg font-bold text-gray-900 mb-2">Global Reach</h3>
              <p className="text-gray-600 text-sm">50+ countries served</p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ClientLogos;
